import{_ as t,c as a,o as s,aN as i}from"./chunks/framework.CMIDsdwV.js";const g=JSON.parse('{"title":"WebUI介绍","description":"","frontmatter":{"title":"WebUI介绍","date":"2024-02-23","tags":["Stable Diffusion","WebUI"],"categories":["Stable Diffusion","WebUI"]},"headers":[],"relativePath":"AIGC/02.WebUI/0_WebUI介绍.md","filePath":"AIGC/02.WebUI/0_WebUI介绍.md","lastUpdated":1769765079000}'),n={name:"AIGC/02.WebUI/0_WebUI介绍.md"};function r(o,e,p,l,h,d){return s(),a("div",null,[...e[0]||(e[0]=[i('<div style="display:none;" hidden="true" aria-hidden="true">Are you an LLM? You can read better optimized documentation at /AIGC\\02.WebUI\\0_WebUI介绍.md for this page in Markdown format</div><h1 id="webui介绍" tabindex="-1">WebUI介绍 <a class="header-anchor" href="#webui介绍" aria-label="Permalink to &quot;WebUI介绍&quot;">​</a></h1><p>WebUI是一款基于AI模型（如Stable Diffusion）的用户界面工具，允许你轻松生成图片、设计艺术作品、甚至实现多样化的创意应用。（重点！它是开源的，免费的！！！）</p><blockquote><p>项目主页：<a href="https://github.com/webui-dev/webui" target="_blank" rel="noreferrer">https://github.com/webui-dev/webui</a></p></blockquote><h2 id="stable-diffusion-webui安装" tabindex="-1">Stable Diffusion WebUI安装 <a class="header-anchor" href="#stable-diffusion-webui安装" aria-label="Permalink to &quot;Stable Diffusion WebUI安装&quot;">​</a></h2><h3 id="第一种方式-自主安装部署" tabindex="-1">第一种方式：自主安装部署 <a class="header-anchor" href="#第一种方式-自主安装部署" aria-label="Permalink to &quot;第一种方式：自主安装部署&quot;">​</a></h3><p>目前，市面上基于Stable Diffusion制作的实用程序中，最受欢迎的是一个由一位越南开发者<a href="https://github.com/AUTOMATIC1111" target="_blank" rel="noreferrer">Automatic1111</a>制作的<a href="https://github.com/AUTOMATIC1111/stable-diffusion-webui" target="_blank" rel="noreferrer">Stable Diffusion WebUI（SD Web UI）</a>，提供了非常可视化的参数调节与对海量扩展应用的支持。</p><h4 id="windows安装方式" tabindex="-1">Windows安装方式 <a class="header-anchor" href="#windows安装方式" aria-label="Permalink to &quot;Windows安装方式&quot;">​</a></h4><ul><li><p><strong>第一步：</strong> 下载前置软件应用：<strong>Python、Git、对应显卡驱动</strong>，按视频指引完成前置安装；</p><p><strong>Python官网下载（3.10.6版本）：</strong></p><p><a href="https://www.python.org/downloads" target="_blank" rel="noreferrer">https://www.python.org/downloads</a></p><p><strong>Git官网下载（最新版）：</strong></p><p><a href="https://git-scm.com/download" target="_blank" rel="noreferrer">https://git-scm.com/download</a></p><p><strong>显卡驱动（按自己的显卡下载并更新到最新版）：</strong></p><p>英伟达显卡驱动：<a href="https://www.nvidia.cn/geforce/geforce-experience" target="_blank" rel="noreferrer">https://www.nvidia.cn/geforce/geforce-experience</a></p><p>AMD显卡驱动：<a href="https://www.amd.com/zh-hans/support" target="_blank" rel="noreferrer">https://www.amd.com/zh-hans/support</a></p></li><li><p><strong>第二步：从代码仓库Git Clone（克隆）WebUI的本体包</strong>；</p><p>找一个比较空的文件夹，选中上方文件路径栏，删除原有内容，输入“cmd“后回车，<strong>打开命令提示符</strong>（命令行）。</p><p><strong>输入如下代码地址敲回车</strong>，从官方地址或者镜像地址克隆项目到你的电脑上：</p><p>官方GitHub地址：</p><div class="language-jsx vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">jsx</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">git clone </span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">https</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">:</span><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">//github.com/AUTOMATIC1111/stable-diffusion-webui.git</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>如果连不上，使用镜像地址：</p><div class="language-jsx vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">jsx</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">git clone </span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">https</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">:</span><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">//gitee.com/nenly/stable-diffusion-webui.git</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div></li><li><p><strong>第三步</strong>：下载一个大模型（Checkpoint），手动放置在根目录下的模型文件夹内；</p><p>大模型格式为.ckpt或.safetensor，放置地址为上面的文件夹（根目录）内的/models/stable-diffusion文件夹内；</p></li><li><p><strong>第四步：<strong>双击运行</strong>webui-user.bat</strong>文件，自动下载部分依赖并等待安装完成；</p><p>安装预计<strong>总占用空间3~4G</strong>左右，一般在30分钟内可完成。</p></li><li><p><strong>第五步：</strong> 等待安装完成，看到 <strong>“Running on Local URL”</strong> 一类的字样后，复制其后的链接在浏览器中打开，即可进入WebUI；</p><p>默认链接是<a href="http://127.0.0.1:7860/" target="_blank" rel="noreferrer">http://127.0.0.1:7860/</a>，如不显示，可以尝试输入这个地址到浏览器中打开</p></li><li><p><strong>第六步（可选）</strong>：安装汉化文件、部分基础扩展和进阶扩展：</p><p>⛔ <strong>建议安装：</strong> 中文本地化补丁（汉化），图库浏览器，Tag Autocompletion（提示词补全）；</p></li><li><p>以后每次运行程序：按第四步中所示方式，双击运行webui-user.bat文件即可。</p></li></ul><h3 id="第二种方式-使用整合包" tabindex="-1">第二种方式：使用整合包 <a class="header-anchor" href="#第二种方式-使用整合包" aria-label="Permalink to &quot;第二种方式：使用整合包&quot;">​</a></h3><p><strong>“整合包”</strong> 一般指开发者对Automatic1111制作的Stable Diffusion WebUI进行打包并使其程序化的一种方式。使用整合包，一般可以省去一些自主配置环境依赖、下载必要模型的功夫。如果你打算使用整合包，以下是一些我推荐的整合包：</p>',11)])])}const u=t(n,[["render",r]]);export{g as __pageData,u as default};
